package com.syntaxBatch11Class8;

public class ContinueKewordsDemo2 {

	

	public static void main(String[] args) {
		// TODO Auto-generated method stub
// print number from 1 to 12 except number 4
		
		
		for(int i=1;  i<=12;  i++) {
		
		
		
		
		if(i==4) {
		continue;
		}
			
		
		
		System.out.println(i+" ");
	}
	}
}
